import React from 'react'
import {
  Typography,
  Avatar,
  Grid,
  Box
} from "@material-ui/core";
import avatar from "../avatar.png";
const Header = () => {
  return (
    <>
      <Box>
        <Avatar src={avatar} alt="akhila"/>
      </Box>
    </>
  )
}

export default Header;
